from sympy.ntheory import factorint
from sympy import Rational
def a(n: int) -> int:
    if n == 1: return 0
    S, P, F = 0, 1, factorint(n)
    for p, e in F.items():
        P *= p**e - 1
        if e == 1: S += Rational(1, p - 1)
    return int(P * S)
print([a(n) for n in range(1, 79)])  # _Peter Luschny_, Jun 22 2025

